import React from "react";
import ReactDom from 'react-dom/client';
function App() {
    return (
        <div>
            <h1>Hello, React!</h1>
            <p>This is a sijnkmple React application.</p>
        </div>
    );
}
const root = ReactDom.createRoot(document.getElementById("calc"));
root.render(<App />);
